import React from "react";
import Sdata from "./Sdata";
import Card from "./Card";


    const App = () => (
    <>
    <h1 className="heading_style"> Top 5 Best Netflix Series in 2020</h1>
    {Sdata.map((val) => {
        return (
        <Card 
         key =  {Sdata[1].id}
         imgsrc ={Sdata[1].imgscr}
         title ={Sdata[1].title}
         sname ={Sdata[1].sname}
         link = {Sdata[1].link}
    />
        );
    })}
    </>
);

export default App;
